import './SortingVisualizer/SortingVisualizer.css';
import SortingVisualizer from './SortingVisualizer/SortingVisualizer';
import Button from './components/Button';
import UtilityBar from './components/UtilityBar';

function App() {
  return (
    <>
      <SortingVisualizer>
        <UtilityBar>
          <Button></Button>
        </UtilityBar>
      </SortingVisualizer>
    </>
  );
}

export default App;
